import React, { Component } from 'react';
import { Link } from "react-router-dom";




class Header extends Component {
   
  render(){
    return (
        <div>
           <Link to="/learn">تعلم </Link>
           <Link to="/contact"> تواصل معنا</Link>
        </div>
    )
  }
}

export default Header;
